import React, {useEffect} from "react";
import axios from 'axios';

function Home()
{
    useEffect( () =>
    {
        (
            async () => 
            {
                await fetch('http://localhost:8000/api/user', {
                    headers: {'Content-type': 'application/json'},
                    credentials: 'include'
                })               
            }
        )
    });

    return (
        <div>
            HOME
        </div>
    )
}

export default Home;
